import React, { Component } from 'react'
import SummarySection from './SummarySection';

export default class Summary extends Component {
    constructor(props) {
        super(props);
    }
  render() {
    return (
      <div id="summary">
        <header>Summary</header>
        <SummarySection
        label="Quality Questions"
        correctAnswers={4}
        totalAnswers={5}
        ></SummarySection>
        </div>
    )
  }
}
